-- ************************************************************************
-- Create schema
-- ************************************************************************
DROP SCHEMA IF EXISTS gcp_gowalla_test CASCADE;
CREATE SCHEMA gcp_gowalla_test;

-- ************************************************************************
-- Create db tables
-- ************************************************************************

-- Create users table
DROP TABLE IF EXISTS gcp_gowalla_test.users;
CREATE TABLE gcp_gowalla_test.users (
	id INTEGER PRIMARY KEY,
	first_name TEXT NOT NULL,
	last_name TEXT NOT NULL,
	dob TIMESTAMP NOT NULL,
	nationality TEXT NOT NULL,
	gender TEXT NOT NULL,
	email TEXT NOT NULL
);


-- Create locations table
DROP TABLE IF EXISTS gcp_gowalla_test.locations;
CREATE TABLE gcp_gowalla_test.locations (
	id INTEGER PRIMARY KEY,
	latitude DOUBLE PRECISION NOT NULL,
	longitude DOUBLE PRECISION NOT NULL,
	country TEXT NOT NULL,
	country_code TEXT NOT NULL
);


-- Create checkins table
DROP TABLE IF EXISTS gcp_gowalla_test.checkins;
CREATE TABLE gcp_gowalla_test.checkins (
	id SERIAL PRIMARY KEY,
	user_id INTEGER NOT NULL,
	location_id INTEGER NOT NULL,
	check_in_time TIMESTAMP NOT NULL,
	FOREIGN KEY (user_id)
		REFERENCES gcp_gowalla_test.users (id),
	FOREIGN KEY (location_id)
		REFERENCES gcp_gowalla_test.locations (id)
);


